import React, { useState } from 'react';
import './App.css';

function App() {

  const [message, setMessage] = useState('empty');

  var requestOptions = {
    method: 'GET',
    redirect: 'follow'
  };

  fetch("http://localhost:8080/users/get-message", requestOptions)
    .then(response => response.text())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));

  return (
    <div className="App">
      <a> This is a message: {message}</a>
    </div>
  );
}

export default App;
